import React from 'react';
import SettingsIcon from '@material-ui/icons/Settings';

function ProfileCard() {
  return (
    <div className="profile">
      <a
        href="https://ibb.co/xMfWZWL"
        style={{ paddingBottom: '10px', position: 'relative' }}
      >
        <img
          src="vinay.jpg"
          alt="michael-dam-m-EZ3-Po-FGs-k-unsplash"
          border="0"
          className="picture"
        />
      </a>
      <div className="settings">
        <SettingsIcon style={{ color: '#535457' }} />
      </div>
      <h4 style={{ color: '#535457' }}>Good Morning Vinay Reddy!</h4>
      <p>Hello</p>
      <p style={{ paddingTop: '10px', color: '#535457' }}>Developer</p>
    </div>
  );
}

export default ProfileCard;
